import React from "react";
import "./Header.css";

const Footer = () => {
  return (
    <header>
      <div class="header">
        <a href="#default" class="logo">
          Event Management System
        </a>
        <div class="header-right">
          <a class="active" href="#home">
            Home
          </a>
          <a href="#contact">Contact</a>
          <a href="#login">Log in</a>
        </div>
      </div>
    </header>
  );
};

export default Footer;
